import React, { useState } from "react";
import { Link } from "react-router-dom";
import "./Login.css";
import axios from "axios";
import { setUserContext, userContext } from "./user";


const state = {
  loading: true,
  data: [],
  equipo: [],
  usuario: '',
};

async function loginUser(credenciales, setUserInfo) {

  const url = "http://localhost:8000/api/Usuarios/?search=" + credenciales.usuario;
  const response = await axios.get(url);
  const data = await response.data;
  
  if(data.length > 0){ 

    if(data[0].password === credenciales.password){

      setUserInfo(data[0].nombre);

    }
    else{

      alert('Comprueba los datos introducidos');

    }
  }
  else{

    alert('Comprueba los datos introducidos');

  }
}

export default function Login() {

  const userInfo = React.useContext(userContext);
  const setUserInfo = React.useContext(setUserContext);
  
  const [usuario, setUsuario] = React.useState({});
  const [password, setPassword] = React.useState({});

  console.log(userInfo);

  const handleLogin = async (e) => {

    e.preventDefault();
    await loginUser({

      usuario,
      password,

    }, setUserInfo);
    
  };

  if (userInfo != null) {
    
    // Mostrará un escenario dependiendo de si estan o no cargados los datos
    if (this.state.loading === true) {
      return (
        <div className="card-container">
          <p>Loading...</p>
        </div>
      );
    } else if (!this.state.data.length === null) {
      return (
        <div className="card-container">
          <p>No se encontraron datos de los jugadores</p>
        </div>
      );
    } else {
      const compraventaJSx = [];
      const equipo = [];
      console.log(equipo);
      this.state.data.forEach((jugador) => {
        compraventaJSx.push(
          <div className="">
            <div className="card-container" key={jugador.jugador}>
              <div className="card-content">
                <button
                  className={
                    this.state.isComprado ?"btn btn-success" : "btn btn-danger"
                  }    
                  onClick={() => {
                    this.buttonHandler(jugador);
                  }}
                >
                  {jugador.jugador}--{jugador.precio}millones --
                  {jugador.equipos}
                </button>
              </div>
            </div>
          </div>
        );
      });
      return (
        <section className="container">
          <div className="row">
            
            <div className="Container">{compraventaJSx}</div>
            
          </div>
        </section>
      );
    }
  
    return (
      <div className="App container">
        <div className="justify-content-center row">
          <h1 style={{ color: "white" }}>Bienvenido</h1>
        </div>
        <div className="justify-content-center row">
            <button
              type='button'
              className="btn btn-warning"
              onClick={() => {setUserInfo(null)}}
            >
              Logout
            </button>
        </div>
      </div>
    );
  }
  else{
  return (
      <div className="App container">
        <div className="justify-content-center row">
          <h1 style={{ color: "white" }}>Inicio de sesion</h1>
        </div>
        <Link to="/Register" className="nav-item nav-link active">
          Registro
        </Link>
        <div className="justify-content-center row">
          <form className="mt-5" onSubmit={handleLogin}>
            <label>
              <p>Username</p>
              <input required type="text" onChange={(e) => setUsuario(e.target.value)} />
            </label>
            <label>
              <p>Password</p>
              <input
                required
                type="password"
                onChange={(e) => setPassword(e.target.value)}
              />
            </label>
            <div>
              <button type='button' className="btn btn-success" type="submit">
                Iniciar Sesión
              </button>
            </div>
          </form>
        </div>
      </div>
    );
  }
}
